    <>
    
    <div className="pageIdentify">Setting</div>
    <div className="settingsPage">
      <Input
        label="Name"
        name="NameChange"
        width="100%"
        labelBgColor="#141d26"
       /* onChange={(e)=> setUsername(e.target.value)} */
      />

      <Input
        label="Bio"
        name="BioChange"
        width="100%"
        labelBgColor="#141d26"
        /* onChange={(e)=> setBio(e.target.value)} */
      />

    </div>
    </>
  );
};

